import DayCategory from "./DayCategory"


function Day(props) {

    const categories = Object.values(props.categories)
    console.log("props.categories", props.categories)
    console.log("categories", categories)

    return (
        <div className="relative">
            <h1 className="text-2xl font-semibold">Day: {props.id}</h1>
            <h1>{categories.map((category) => <DayCategory key={category.id} id={category.id} cells={category.cells}/> )}</h1>
            <div>

            </div>
        </div>
    )
}

export default Day
